    render() {
        return (
        <div>
                <div className="sidebar">
                <div className="logo-div">
                    <img className="logo" src={buttercrust} alt="headlogo"/>
                </div>
                <br></br>
                <div>
                <Typography className="sidenav">Pizzas</Typography>
                </div>
                <div>
                    <button className="btn-sidemenu">Done</button>
                </div>
        </div> 
            </div>
        )
    }
}

export default Sidebar
